import { Link } from "react-router-dom";

const AboutUs = () => {
  return (
    <div>
      <div class="card" style="width: 18rem;">
        <img
          src="../images/aboutus.jpg"
          class="card-img-top"
          alt="about_us_pic"
        />
        <div class="card-body">
          <h5 class="card-title">About Us</h5>
          <p class="card-text">
            <b>Code With Murad</b> is Youtube Channel, Where we upload all our
            software projects for students so that they can use it for learning
            purpose and Submission purpose in their Univerties.{" "}
          </p>
        </div>

        <div class="card-footer">
          <Link to="/contact">
            <button type="button" class="btn btn-link">
              Contact Us
            </button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default AboutUs;
